import React from 'react';
import './Skills.css';

const Skills = () => {
    return (
        <div className="skills">
            <h2>Skills</h2>
            <ul>
                <li>AWS</li>
                <li>GCP</li>
                <li>DevOps</li>
            </ul>
        </div>
    );
};

export default Skills;
